import React from 'react';
import Tour from './Tour';
const Tours = ({ tours }) => {
  return (
    <section>
      <div className='title'>
        <h2> Our tours</h2>
        <div className='underline'></div>
      </div>

      <div>
       {
         tours.map((tour) => {
          //  console.log(tour)
           return <Tour key={tour.id} {...tour}></Tour>
         })
       }
      </div>
    </section>
  );
};

export default Tours;
